  "description": "<p align=\"justify\">Schesir Tuna Natural Style Cat Food is a grain free, gluten free wet food that is marinated in natural gravy. This delicious food is made with real, human grade tuna that is lightly steam to lock in important nutrients. It is an exceptionally healthful choice for cats and has everything your cat needs to thrive. This includes Omega-3 and Omega-6 fatty acids for healthy skin and coat. It also includes high volumes of protein, for long, lean muscles. Schesir Chicken Fillet Canned Cat Food is a protein dense wet food that comes packed in tasty jelly. Your cat will love the texture and taste of this food! Humanely raised chicken that has been hand processed and lightly steamed goes into every can. In fact, only the best cuts of meat are used in Schesir canned cat food formulas. This food is free from artificial colours or preservatives, too. It contains all of the nutrition your cat needs to thrive, no matter their age. Feed it as a complete meal, or try mixing it with your cat's favourite kibble.</p>\n<p align=\"justify\"><strong>Features:</strong></p>\n<ul>\n<li>A protein-rich diet, perfect for felines</li>\n<li>Made with high quality, human grade meats</li>\n<li>An all natural canned cat food made with sustainable ingredients</li>\n<li>Complementary food for all adult cats<br>\n</li>\n<li>Free from added colours or preservatives</li>\n</ul>\n<p><strong>Composition:</strong></p>\n<ul>\n<li>Tuna 51%.</li>\n<li>Chicken fillets 4.7%.</li>\n<li>Rice 1.5%.</li>\n</ul>\n<p><strong>Analytic components:</strong></p>\n<ul>\n<li>Protein 12%.</li>\n<li>Crude oils and fats 0.8%.</li>\n<li>Crude fibers 0.5%.</li>\n<li>Crude ash 1%.</li>\n<li>Moisture 85%.</li>\n<li>78.8 kcal/100 g.</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<p><b>Tuna: </b>The used species are only two: the Euthynnus affinis (called Bonito) and the Katsuwonus pelamis (called Skipjack): these are species not over-exploited. They are caught in the open sea with sustainable methods that guarantee the protection of dolphins and endangered species (Ocean friendly).<br><b></b></p>\n<p><b>Chicken</b>: The chickens used in organic products are bred in Germany and Holland according to the rules laid down for organic farming. Chickens used in Schesir wet products are bred in Thailand, following the hygienic-sanitary guidelines provided by the European Regulations. They belong to the species Gallus domesticus, of the Phasianidae family (birds of Indian origin). The chicken contains proteins of high biological value, which provide all the amino acids the pet needs.</p>",
