  "handle": "cat-tree-with-pom-pom",
  "description": "<p><i><span style=\"font-weight: 400;\">For the love of purrs &amp; paws that do not pause!</span></i></p>\n<p><span style=\"font-weight: 400;\">We love our cats' zoomies, but scratches &amp; claw marks on your furniture are a big no no. But those paws must not pause! Keep your feline friend engaged &amp; entertained for hours with the HUFT Goofy Tails Cat Tree. The posts covered in natural sisal fibre offer the ideal texture for scratching &amp; clawing‚¬€keeping their nails healthy &amp; away from the furniture &amp; flooring. They can climb onto &amp; rest atop the plush platforms, spacious enough to host 2 cats at once. The soft pom poms make playtimes interactive &amp; fun!</span></p>\n<p><span style=\"font-weight: 400;\">The cat tree is also super easy to assemble yourself. Just follow the instruction manual that comes with it to build your cat's dreamland with your own hands!</span></p>\n<p><b>Here's why your cat will love it:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Engaging, entertaining &amp; interactive</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Ideal for climbing, clawing &amp; nap times</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Posts wrapped in natural sisal fibre, offering optimal texture for scratching</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Pom pom attachment to keep cats engaged for hours </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Sturdy base for secure placement </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Easy to assemble, comes with an instruction manual &amp; tools</span></li>\n</ul>\n<p><b>Care Instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Do not wash.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Keep away from water &amp; moisture.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Clean with a dry cloth or a vacuum cleaner only.</span></li>\n</ul>\n<p><b>HUFT Tips:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Keep the cat tree in visible areas of the house, where your cat sleeps or spends the most time.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Select the appropriate size for your cat.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Keep away from children.</span></li>\n</ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>\n<ul></ul>",
