  "handle": "whiskas-adult-dry-food-chicken-1-2-kg",
  "description": "<p>This chicken kibble is not just irresistible but also helps keep their teeth clean (by scraping of plaque and tartar as they chew). Whiskas works closely with experts at the WALTHAM Centre for Pet Nutrition to create delicious diets that improve the quality of your cat's life. Whiskas cat food contains a unique patented combination of zinc + omega 6 fatty acids that help improve the skin and coat.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Food Type: Dry cat food</li>\n<li>Suitable for adult cats above 1 year</li>\n<li>Made with chicken</li>\n<li>Patent protected combination of zinc + omega 6 fatty acids</li>\n<li>AAFCO approved</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<p><strong>Ingredients: </strong>Wholegrain cereals (corn, rice, wheat), corn gluten meal, poultry and poultry by-products, soy bean products, (full fat soy bean, soybean meal) palm stearin, ocean fish, wheat flour, minerals, iodised salt, vitamins, taurine, soy oil, methionine, food colouring, preservatives, flavour.</p>\n<p><strong>Analytical Constituents (%):</strong></p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/1.1_ac46223e-784d-4575-a916-06aee6aca4f7_large.JPG?v=1556951124\" alt=\"\"></p>\n<p><strong>HUFT Tip: </strong>If you have more than one cat and one of the cats doesn't eat his (or her) entire meal at once, cover the bowl with a plate or keep it out of reach from the other cat. This will prevent him/her from overeating. Wet food can be refrigerated for short periods of time.</p>",
