  "title": "Signature Grain Zero Adult Dry Cat Food - All Breed Formula",
  "handle": "signature-grain-zero-adult-dry-cat-food-all-breed-formula",
  "description": "<p><span style=\"font-weight: 400;\">Formulated by </span><span style=\"font-weight: 400;\">veterinarians and nutritionists in the U.S.A, </span><span style=\"font-weight: 400;\">Signatures Grain Zero hypoallergenic Cat Food is complete nutrition is made for adult cats of all breeds. </span></p>\n<p><span style=\"font-weight: 400;\">Made with selected ingredients - ocean fish, high protein deboned sardine and mackerel, this dry kibble is great for weight management, coat care and joint protection. The formula uses only high quality, human grade protein sources of fibre to provide your cat with optimal nutrient absorption. </span></p>\n<p><span style=\"font-weight: 400;\">It also contains chicken liver which helps build strong muscles.</span></p>\n<p><strong><b data-mce-fragment=\"1\">Ingredients and Benefits</b>:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Taurine, an essential amino acid for heart and eye health </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Omega 3 and 6 fatty acid for shiny coat and healthy skin </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Carefully balanced calories from proteins and fat for a healthy body weight </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Chicken liver to help build strong muscles</span></li>\n</ul>\n<p><b>Features:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Hypoallergenic complete nutrition cat food </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Great for adult cats of all breeds </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made with real ocean fish, sardine and mackerel </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Balanced calories for a healthy body weight </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Includes 48% meat</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Contains no corn, wheat or soya </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">No added artificial preservatives or by-products</span></li>\n<li style=\"font-weight: 400;\">\n<div class=\"c-message_kit__gutter\">\n<div data-qa=\"message_content\" class=\"c-message_kit__gutter__right\" role=\"presentation\">\n<div class=\"c-message_kit__blocks c-message_kit__blocks--rich_text\">\n<div data-qa=\"message-text\" class=\"c-message__message_blocks c-message__message_blocks--rich_text\">\n<div data-qa=\"block-kit-renderer\" class=\"p-block_kit_renderer\">\n<div class=\"p-block_kit_renderer__block_wrapper p-block_kit_renderer__block_wrapper--first\">\n<div dir=\"auto\" class=\"p-rich_text_block\">\n<div class=\"p-rich_text_section\">Formulated in US to meet the nutritional levels established by the AAFCO.</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</li>\n</ul>\n<p><strong>Nutritional Analysis:</strong><span> Protein (Min) 28.0%, Fat (Min) 16.0%, Crude Fibre (Max) 4.5%, Moisture (Max) 10%.</span></p>",
