  "title": "Bubble Up - Purr & Pretty Cat Shampoo - 200 ml",
  "handle": "bubble-up-purr-pretty-cat-shampoo",
  "description": "<p><span style=\"font-weight: 400;\">Open the bottle, take a whiff of that calming scent and let your cat enjoy a gentle, refreshing and bubbly bath.</span></p>\n<p>Specially formulated for cats, this sulphate-free cat shampoo lathers well to revitalize skin and restore fur shine. How? This plant based formula has the perfect pH balance for cat coats. While Chamomile extract and Aloe Vera gently reduces itchiness, Shea Butter and Vitamin E moisturizes the skin and leaves a glossy coat behind.</p>\n<p><span style=\"font-weight: 400;\">The part we love the most is that we made it all cruelty free and vegan friendly.</span></p>\n<p align=\"justify\"><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Moisturising cat shampoo</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Contains Chamomile, Shea Butter and Vitamin E</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Lathers well and smells heavenly</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">pH-balanced formula</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Free of sulphate, paraben, silicone and alcohol</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Cruelty free and vegan friendly</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Suitable for all cats and kittens (12 weeks and above)</span></li>\n</ul>\n<p><b>How To Use: </b><span style=\"font-weight: 400;\">Wet the coat and apply shampoo. Work it into a lather and rinse it off thoroughly with clean water. Protect the eyes and ears from water or shampoo.</span></p>\n<p><b>Burst The Bubble: </b>Did you know that while cats groom themselves, it doesn't mean they do not need frequent grooming and bathing. To protect your kittys coat and skin from dander, dandruff and bad odour, give them a gentle, bubbly bath that leaves them smelling amazing!</p>",
