  "title": "HUFT Personalised Dog & Cat Name Tag - Round - 3.5cm X 3cm",
  "handle": "huft-personalised-dog-cat-name-tag-round-3-5cm-x-3cm",
  "description": "<p>The best way to help your pet make his way back to you us with an ID Name tag for dogs and cats. This circular design is convenient and easy to wear. Personalise it with your pet's name and your contact details so anyone will know who your fur-baby belongs to! Our brass tags are chrome plated on one side and unfinished silver on the other so that they can be engraved. Long-lasting and strong these dog tags are an absolute MUST HAVE for every pet! All our tags come with a metal ring that can be used to attach the tag to the dog's collar. Available in multiple colours!</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Long-lasting and string</li>\n<li>\n<strong>Size:</strong> 3.5cm X 3cm<br>\n</li>\n<li>\n<strong>Shape:</strong> Round</li>\n<li>\n<strong>Material: </strong><span></span>Brass with chrome coating on one side and <span>unfinished silver on the other</span>\n</li>\n<li>Comes with a metal ring that can be used to attach the tag<br>\n</li>\n</ul>\n<p><strong>How to Personalize: </strong>To personalise this name tag, please add your pet's name in the field - \"Front Text\", and your contact details in the field - \"Back Text\".</p>\n<p><strong>HUFT Tip: </strong><span>Personalized name tags cannot be returned or exchanged</span></p>",
