  "handle": "huft-indian-collectives-hathi-pet-mat",
  "description": "<p data-mce-fragment=\"1\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Designed in rich shades of blue, the Haathi print is distinctively Indian. As comfortable as it is aesthetic, this mat features a light polyfil stuffing. Pet mats are a great way to create an instant snooze-spot for your furry - just spread it out on the floor or in the car. The attached straps make it easy to roll up and carry with you.</span></p>\n<p data-mce-fragment=\"1\"><strong>Features:</strong></p>\n<ul data-mce-fragment=\"1\">\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Polycanvas fabric</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Light polyfil stuffing</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">With accompanying strap</span></li>\n<li style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\">Versatile use - can be spread out in the car, on the sofa or on the floor</span></li>\n</ul>\n<p data-mce-fragment=\"1\"><b data-mce-fragment=\"1\">Care instructions:</b><span style=\"font-weight: 400;\" data-mce-fragment=\"1\" data-mce-style=\"font-weight: 400;\"> Can be washed in a machine. Choose a normal cycle with the temperature set to cold. Allow it to air dry in the sun.</span></p>",
