  "handle": "savic-gizmo-cat-litter-tray-with-rim-blue-20-x-14-x-5-inches",
  "description": "<p>Gizmo is a stylish litter tray with removable rim. The holes in the rim prevent litter from falling outside the tray when leaving. Moreover, the raised back keeps urine and litter inside for a clean &amp; tidy area around the tray. Finally, the Gizmo tray has a low entrance which makes the tray suitable for younger, elderly, and sick cats. For a fast &amp; easy cleaning and extended lifetime of the litter tray, we recommend using litter trays bag Bag it Up Medium for Gizmo Medium.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Holes in the rim prevent litter falling outside the tray when leaving</li>\n<li>Raised back keeps urine and litter inside, clean &amp; tidy area around the tray</li>\n<li>Lower entrance, suitable for younger, elderly and sick cats</li>\n<li>Fast &amp; easy cleaning and extended lifetime of the toilet home, use Bag it Up litter tray bags</li>\n<li>Dimension: 50.8 x 35.6 x 12.7 cm</li>\n</ul>",
