  "title": "Whiskas Ocean Fish Adult Wet Cat Food - 80 g packs",
  "handle": "whiskas-ocean-fish-adult-wet-cat-food-80-g",
  "description": "<p>This protein-rich diet will feed your cat's innate love for fish and also provide them with a good amount of moisture and all the right nourishment to help keep their fur, bones, skin, muscles, heart-health and overall immunity in great shape. Whiskas food has been developed with experts at the WALTHAM Centre for Pet Nutrition and contains a unique patented combination of zinc + omega 6 fatty acids that help to maintain the skin and coat.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Food Type : Wet cat food</li>\n<li>Suitable for adult cats above 1 year</li>\n<li>Patent protected combination of zinc + omega 6 fatty acids</li>\n<li>Consult a vet before altering your pet's diet</li>\n<li>Always have fresh water available for your pet</li>\n<li>Never feed above recommended quantities unless prescribed by a vet</li>\n</ul>\n<p><strong></strong><strong>Feeding Guide: </strong>Feeding requirements will vary based on your pet's level of activity, environment and age.</p>\n<p><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/5_2bf12b3b-647a-43cb-b40b-1e4ab31c3217_large.JPG?v=1556951530\" alt=\"\"></p>\n<p><strong>Please Note: </strong>This is just an initial guide, we suggest you check with a vet for specific changes in quantity to suit your pet.</p>\n<p><strong>Ingredients: </strong>Wholegrain cereals (corn, rice, wheat), corn gluten meal, poultry and poultry by-products, soy bean products, (full fat soy bean, soybean meal) palm stearin, ocean fish, wheat flour, minerals, iodized salt, vitamins, taurine, soy oil, methionine, food colouring, preservatives, flavour.</p>\n<p><strong>Analytical Constituents (%):</strong></p>\n<p><strong><img src=\"//cdn.shopify.com/s/files/1/0086/0795/7054/files/5.1_5bdf16f4-182c-4a29-abf3-c0c6e8e35fd6_large.JPG?v=1556951538\" alt=\"\"></strong></p>\n<p><strong>HUFT Tip: </strong>Your cat's amazing coat is one of the best indicators of whether they are getting the right nutrition. If the coat is dull and lifeless your cat could be lacking in some specific nutrients. Check with your vet about it.</p>",
