  "title": "Schesir 51% Tuna with Aloe Wet Food For Kittens - 85 g",
  "handle": "schesir-51-tuna-with-aloe-wet-food-for-kittens-85-g",
  "description": "<p>Schesir Tuna with Aloe Canned Cat Food is a unique cat food not found anywhere else. This carefully crafted formula uses the benefits of aloe to give your cat a nutritional boost. Aloe is rich in natural antioxidants, essential enzymes, and other nutrients. This formula also includes eco-friendly tuna that is lightly steamed. Schesir Tuna with Aloe Canned Cat Food is a complete and balanced diet for cats of all ages. This interesting flavour is nutrient dense, and has everything your cat needs to thrive. It is a tasty option for cats of all ages. Schesir foods are free from artificial colours or preservatives.</p>\n<p><strong>Features:</strong></p>\n<ul>\n<li>Nutrient dense, containing everything your cat needs to thrive</li>\n<li>A fishy flavour that cats love</li>\n<li>A complete diet for all ages of cats</li>\n<li>Uses the power of aloe to give your cat a nutrition boost</li>\n<li>Free from artificial colours or preservatives</li>\n</ul>\n<p><strong>Composition:</strong></p>\n<ul>\n<li>Tuna 51%.</li>\n<li>Aloe 4.7%.</li>\n<li>Sunflower oil 1.6%.</li>\n<li>Rice 1%</li>\n</ul>\n<p><strong>Analytic components:</strong></p>\n<ul>\n<li>Protein 11%</li>\n<li>Crude oils and fats 1.5%</li>\n<li>Crude fibers 0.5%</li>\n<li>Crude ash 1%</li>\n<li>Moisture 85%</li>\n<li>86.4 kcal/100 g</li>\n</ul>\n<p><strong>Ingredients:</strong></p>\n<b>Tuna: </b>The used species are only two: the Euthynnus affinis (called Bonito) and the Katsuwonus pelamis (called Skipjack): these are species not over-exploited. They are caught in the open sea with sustainable methods that guarantee the protection of dolphins and endangered species (Ocean friendly).<br><b>Aloe: </b>Succulent plant Aloe barbadensis Miller, from the Aloeaceae family. It comes from local crops to reduce the impact of transport on the production process. It is a perennial shrub of which the fleshy leaves are used. It is a topping in Schesir wet products to give more flavor to the recipe and as a source of fiber.",
