  "description": "<p><span data-mce-fragment=\"1\">Creamy licious treats that will make your cat go meow! Delight them with Temptations Creamy Purrrr-ee Cat Treats which is loaded with deliciousness of chicken and real tuna. The high magnesium content and rich vitamins like Vitamin E, B3 and B5 make Temptations cat treats a healthier choice for your furball. Use it as a food topper to make your furball meal extra delicious &amp;amp; creamy or serve it in a bowl for a mess-free treating. You can even strengthen the bond with your cat by feeding Temptations treat with your hand. No matter how you feed, these treats are surely going to make your cat day purr-fact. These likable treats with soft and creamy texture and deliciousness of chicken and tune are just perfect to delight your cat taste buds. And guess what? Temptations cat treats come in single-serve pouches for convenience and to ensure mess-free treating.</span></p>\n<p><strong>Features:</strong></p>\n<ul class=\"a-unordered-list a-vertical a-spacing-mini\">\n<li><span class=\"a-list-item\">Irresistibly creamy, these puree cat treats deliver the flavor and texture your cat will come running for</span></li>\n<li><span class=\"a-list-item\">Feed this deliciously likable treat by hand for a playful bonding experience or serve in a bowl to your favorite feline</span></li>\n<li><span class=\"a-list-item\">Use as a cat food topper to make their mealtime even more fun</span></li>\n<li><span class=\"a-list-item\">Convenient single-serve pouches make daily treating easy just open the top and squeeze the tube</span></li>\n</ul>\n<p><strong>Ingredients: Cat Treats</strong></p>\n<style type=\"text/css\"><!--\ntd {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}\n--></style>\n<ul>\n<li><span data-mce-fragment=\"1\">Chicken Meat</span></li>\n<li><span data-mce-fragment=\"1\">Tuna</span></li>\n<li><span data-mce-fragment=\"1\">Thickening Agents (Modified Starch, Guar Gum, Xanthan Gum)</span></li>\n<li><span data-mce-fragment=\"1\">Chicken Flavour</span></li>\n<li><span data-mce-fragment=\"1\">Tuna Flavour</span></li>\n<li><span data-mce-fragment=\"1\">Vitamin E</span></li>\n<li><span data-mce-fragment=\"1\">Preservative</span></li>\n<li><span data-mce-fragment=\"1\">Sodium Nitrite</span></li>\n</ul>\n<p><span data-mce-fragment=\"1\"><strong>Storage instructions:</strong> Store in a cool, dry place</span></p>",
