  "id": 2295090544702,
  "title": "Royal Canin Mother And Babycat Dry Cat Food",
  "handle": "royal-canin-mother-and-babycat-dry-cat-food",
  "description": "<p><span>If your cat is pregnant or has given birth recently, it's important that both she and her kittens have the correct nutritional support to ensure continued health for the mother, and the best start possible for the kittens. ROYAL CANIN Mother &amp; Babycat is formulated with the nutritional needs of the mother and her kittens in mind. Suitable for gestating/lactating queens as well as 1-4 month old kittens, this food contains a patented complex of antioxidants which help to support the kittens' natural defences. The soft texture of the kibble makes it easy for the kittens to chew and swallow, allowing them to get used to solid food as part of their diet. ROYAL CANIN® Mother &amp; Babycat is specially enhanced for digestive tolerance as it reduces the amount of undigested nutrients. It's enriched with DHA, which is a natural omega-3 fatty acid that helps to support your kitten's general brain development. To cater to each cat's individual preferences, ROYAL CANIN® Mother &amp; Babycat food is also available as an ultra soft mousse. If you're considering mixed feeding, simply follow our feeding guidelines to ensure your cat gets an accurate amount of both wet and dry food for optimal benefit.</span></p>\n<p><strong>Features:</strong></p>\n<p><span><b>Immune system support : </b>Between 4 and 12 weeks after birth, the natural immunity acquired from the mother's colostrum decreases gradually. Mother &amp; baby cat helps support the 1st age kitten's natural defences thanks particularly to a patented* complex of antioxidants including vitamin E.</span></p>\n<p><span><b>Special easy weaning : </b>Adapted kibble that can be easily rehydrated to facilitate the transition from milk to solid food.</span></p>\n<p><span><b>Digestive health : </b>Adapted kibble that can be easily rehydrated to facilitate the transition from milk to solid food.</span></p>\n<p><span><b>Enriched with DHA : </b>DHA helps support the kitten's cerebral development during gestation and lactation.</span></p>\n<div class=\"rc-layout-container rc-padding-y--sm rc-padding-top--none--desktop rc-bg-colour--brand3\">\n<div class=\"rc-column rc-full-width\">\n<div class=\"rc-padding-y--md rc-max-width--md rc-showhide\" id=\"tab__panel-1--single-202\" aria-expanded=\"true\" aria-hidden=\"false\">\n<div class=\"rc-margin-y--none--desktop\">\n<strong>Ingredients</strong>: Balanced and complete feed for cats - Specially for the queen and her kittens - Gestating and lactating queen - 1st age kittens (from 1 to 4 months old) during weaning.</div>\n<div class=\"rc-margin-y--none--desktop\">\n<p><strong>Composition:</strong> Dehydrated poultry protein, animal fats, maize flour, rice, vegetable protein isolate*, hydrolysed animal proteins, yeasts and parts thereof, fish oil, beet pulp, vegetable fibres, soya oil, minerals, fructo-oligo-saccharides (0.35%), hydrolysed yeast (source of manno-oligo-saccharides), yeast extracts (source of betaglucans), marigold extract (source of lutein).</p>\n<p><strong>Additives (per kg):</strong> Nutritional additives: Vitamin A: 25500 IU, Vitamin D3: 1000 IU, Vitamin E: 600 mg, E1 (Iron): 31.8 mg, E2 (Iodine): 3.2 mg, E4 (Copper): 9.8 mg, E5 (Manganese): 41.4 mg, E6 (Zinc): 118.1 mg, E8 (Selenium): 0.04 mg - Technological additives: Clinoptilolite of sedimentary origin: 5 g - Preservatives - Antioxidants.</p>\n<p><strong>Analytical constituents:</strong> Protein: 34% - Fat content: 25% - Crude ash: 7.4% - Crude fibres: 1.9% - DHA: 1.87 g/kg.</p>\n</div>\n<div class=\"rc-margin-y--none--desktop\">\n<div class=\"rc-layout-container rc-padding-y--sm rc-padding-top--none--desktop rc-bg-colour--brand3\">\n<div class=\"rc-column rc-full-width\">\n<div class=\"rc-padding-y--md rc-max-width--md rc-showhide\" id=\"tab__panel-1--single-202\" aria-expanded=\"true\" aria-hidden=\"false\">\n<div class=\"rc-margin-y--none--desktop\"><strong>Feeding Guidelines:</strong></div>\n<div class=\"rc-margin-y--none--desktop\">\n<table class=\"rc-table-age\">\n<tbody>\n<tr>\n<th>KITTEN'S AGE</th>\n<th>KITTEN'S WEIGHT</th>\n<th>DRY FOOD ONLY</th>\n<th>DRY &amp; WET FOOD</th>\n</tr>\n<tr>\n<td>1 month</td>\n<td>0.4 kg</td>\n<td>26 g</td>\n<td>5 g + 1/2 pouch</td>\n</tr>\n<tr>\n<td>2 months</td>\n<td>1 kg</td>\n<td>45 g</td>\n<td>22 g + 1/2 pouch</td>\n</tr>\n<tr>\n<td>3 months</td>\n<td>1.3 kg</td>\n<td>57 g</td>\n<td>13 g + 1 pouch</td>\n</tr>\n<tr>\n<td>4 months</td>\n<td>2 kg</td>\n<td>61 g</td>\n<td>16 g + 1 pouch</td>\n</tr>\n<tr>\n<td>Gestating queen</td>\n<td>4 kg</td>\n<td>62 - 96 g</td>\n<td>16 - 50 g + 1 pouch</td>\n</tr>\n</tbody>\n</table>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n<div class=\"rc-table\"><br></div>",
