  "description": "<p>Elevate your cat's nap time with a personal touch that only you can add, Our HUFT Cloudy cat bed can now be personalized with up to 10 characters of your choice using emojis, text, numbers, or a combination of all. Give your feline friend a bed that's uniquely theirs, and let them feel loved and cherished.</p>\n<p><span style=\"font-weight: 400;\">Crafted from soft faux fur and luxurious velvet, our bed offers maximum comfort and style. With an anti-skid base and side handle, it's the perfect choice for any cat. </span></p>\n<p><strong>Features:</strong></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Up to 10 character engraving option</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made-to-order product, take 7 working days to get ready</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Dimensions: 21.5 x 21.5 x 5 inch</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Soft &amp; comfortable cat bed</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made of faux fur &amp; velvet</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Perfect for naps and kneading</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Anti-skid base</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Handle on the side to hold</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Removable and washable cover</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Colour: Maroon, Dark Navy, Dark Green</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Made in India, with love</span></li>\n</ul>\n<p><b>Care instructions:</b></p>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">The cover can be machine washed on a gentle cycle with a mild detergent. However, we recommend that you wash it by hand. To dry, hang in the shade.</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">It is ideal to wash the cover separately.</span></li>\n</ul>",
